import FadeIn from 'react-fade-in';
import { useState, useEffect} from 'react';

import {Heading, Icon} from 'react-bulma-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGripHorizontal } from '@fortawesome/free-solid-svg-icons';
import {SortableContainer, SortableElement} from 'react-sortable-hoc';
import {arrayMoveImmutable} from 'array-move';

import Header from './Header.jsx';

import React from 'react';
import Typed from "typed.js";

import './App.css';
import 'bulma/css/bulma.min.css';
import logo from './logo.svg';

class ListTitle extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      titleEditMode: false
    }
  }

  render() {
    return (
        <div class="list-header columns is-centered">
          <div class="column is-3 has-text-centered">
          { 
            this.state.titleEditMode ?
            <div class="field">
              <p class="control">
                <input class="input" type="text" placeholder="New Title"/>
              </p>
            </div>
            :
            <div className="title is-2">New Title</div>
          }
          </div>
        </div>
      );
  }
}
class InstaList extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
          <ListTitle/>
      </div>
      );
  }
}


function App() {
  return (
    <div className="App">
      <section class="section">
        <div class="container">
          <Header/>
          <InstaList/>
        </div>
      </section>
    </div>
  );
}

export default App;
